import React from "react";
import { Table } from 'reactstrap';


const WorkoutWeekTable = ({workouts}) => {

    return (
        <Table>
            <thead>
            <tr>
                <th>Mo</th>
                <th>Tu</th>
                <th>We</th>
                <th>Th</th>
                <th>Fr</th>
                <th>Sa</th>
                <th>Su</th>
            </tr>
            </thead>
            <tbody>
            <tr>
                {workouts.map(workout => <tr key={workout.id}><td>{workout.name}</td></tr>)}
            </tr>
            </tbody>
        </Table>

    )
}

export default WorkoutWeekTable;


